def getimage(path):
  img=cv2.imread(path,cv2.IMREAD_UNCHANGED)
  img=cv2.cvtColor(img, cv2.COLOR_BGR2RGB) # passo dallo spazio BGR a quello RGB
  img=np.float32(cv2.resize(img,(224,224),interpolation=cv2.INTER_NEAREST))/255
  return img

def onehot_to_int(onehot_img):
  #Funzione per convertire mappa di segmentazione codificata one-hot a una mappa
  #di interi (classi) [0,8]
  #utilizzata per visualizzare l'immagine di uscita (di default è a 8 canali)->per ogni pixel è associato un array di 8 bit
  #argmax restituisce l'indice dell'array dove sta il valore max (corrisponde alla classe di appartenenza)
  img=np.argmax(onehot_img, axis=-1)
  return img

