#Funzione per visualizzare img del Dataset
def view(image_frame, label_map):
    # Assegno colori RGB alle 7+1 classi(livelli di grigio) della mappa di segmentazione
    colors = np.array([
        [128, 64, 18],      # Drivable # marrone
        [244, 35, 232],     # Non Drivable #rosa
        [220, 20, 60],      # Living Things #rosso
        [0, 0, 230],        # Vehicles #blu
        [220, 190, 40],     # Road Side Objects #giallo
        [70, 70, 70],       # Far Objects #grigio
        [70, 130, 180],     # Sky #azzurro
        [0, 0, 0]           # Misc #nero
    ], dtype=int)

    color_image = np.zeros(
        (label_map.shape[0], label_map.shape[1], 3), dtype=int) # stessa dimensione della mappa di segmentazione
    for i in range(8):
        color_image[label_map == i] = colors[i]

    # color_image[label_map == 7] = colors[7]

    print("Shape img rgb: ",image_frame.shape," type:",image_frame.dtype,"[vmin,vmax]= ",np.min(image_frame),",",np.max(image_frame))
    print("Shape img mask: ",label_map.shape," type:",label_map.dtype,"[vmin,vmax]= ",np.min(label_map),",",np.max(label_map))
    print("Shape img mask colorata:", color_image.shape)

    plt.figure(figsize=(10,10))
    plt.subplot(1,2,1); plt.imshow(image_frame); plt.title("Train")
    plt.subplot(1,2,2); plt.imshow(color_image); plt.title("Mask")
    plt.show()

