# Definizione del DataLoader (Sequence)
class IDDLiteSequenceLoader(keras.utils.Sequence):
  def __init__(self,x_set,y_set,batch_size,shuffle=True):
    self.x, self.y = x_set, y_set
    self.batch_size = batch_size
    self.shuffle=shuffle # per generare le immagini in ordine casuale ad ogni training
    self.indices = np.arange(len(self.x),dtype=int) # array con indici delle immagini [0,1403]

  def __len__(self): # numero di batch nel Sequence
    return math.ceil(len(self.x)/self.batch_size)

  def __getimage(self,path):
    img=cv2.imread(path,cv2.IMREAD_UNCHANGED)
    img=cv2.cvtColor(img, cv2.COLOR_BGR2RGB)
    img=np.float32(cv2.resize(img,(224,224),interpolation=cv2.INTER_LINEAR))/255
    return img.reshape((224,224,3))

  def __getmask(self,path):
    img=cv2.imread(path,cv2.IMREAD_UNCHANGED)
    img[img>=255]=7 #Assegno agli eventuali pixel che hanno classe Misc (livello 255) il livello 7
    # nella ground truth, alla classe 7 è associato il colore bianco

    img=cv2.resize(img,(224,224),interpolation=cv2.INTER_NEAREST)
    return img.reshape((224,224,1))

  def __randomcrop(self,batch_x, batch_y, crop_size):
    cord_x = np.random.randint(0,224-crop_size)
    cord_y = np.random.randint(0,224-crop_size)

    batch_x = batch_x[:,cord_x:cord_x+crop_size, cord_y:cord_y+crop_size,:]
    batch_y = batch_y[:,cord_x:cord_x+crop_size, cord_y:cord_y+crop_size,:]
    #Per ogni img nel batch fai un reshape (crop di (crop_size,crop_size,3) e poi un resize per riportare l'img a risoluzione 224,224)
    batch_x=np.array([cv2.resize(img.reshape((crop_size,crop_size,3)),(224,224),interpolation=cv2.INTER_LINEAR) for img in batch_x])
    batch_y=np.array([cv2.resize(img,(224,224),interpolation=cv2.INTER_NEAREST) for img in batch_y])
    return batch_x, batch_y


  def __randomblackpatch(self,batch_x):
    patch_size_x=random.randint(5,20)
    patch_size_y=random.randint(5,20)
    cord_x = np.random.randint(0,224-patch_size_x)
    cord_y = np.random.randint(0,224-patch_size_y)

    batch_x[ :,cord_x:cord_x+patch_size_x, cord_y:cord_y+patch_size_y, :]=0
    return batch_x


  def __augment(self,batch_x,batch_y):

    # FLIP
    if(random.randint(0,1)>=0.5): # da rimettere a 0.5
       batch_x=batch_x[:,:,::-1,:]
       batch_y=batch_y[:,:,::-1,:]
       #print("ho flippato")


    # MODIFICA CONTRASTO
    if(random.randint(0,1)>=0.5):
      gamma=random.uniform(0.5,1.75)

      for i in range(0,len(batch_x)):
        img = rgb2hsi(batch_x[i])
        img[ : , : , 2] = img[ : , : , 2]**gamma
        img = hsi2rgb(img)
        batch_x[i] = np.clip(img , 0, 1) # riporto i valori tra 0 ed 1
      #print("modificato contrasto di gamma: ", gamma)

    """
    # PATCH NERE
    if(random.randint(0,1)>=0.5):
      batch_x=self.__randomblackpatch(batch_x)
      #print("ho blackpatchato")

    # ROTAZIONE
    if(random.randint(0,1)>=0.5):
      for i in range(0,len(batch_x)):
        batch_x[i] = rotate(batch_x[i], 15, preserve_range = True, mode = 'reflect')
        batch_y[i] = rotate(batch_y[i], 15, preserve_range = True, order = 0, mode = 'reflect')
      batch_x, batch_y = self.__randomcrop(batch_x, batch_y, 150)
      #print("ho zommato e ruotato")
    """

    # RUMORE
    if(random.randint(0, 1) >= 0.5):
      for i in range(0,len(batch_x)):
        batch_x[i] = np.clip(batch_x[i] + 0.025 * np.random.randn(224, 224, 3), 0, 1)
      #print("rumore")
    return batch_x, batch_y



  def __getitem__(self,index): # costruisce i batch size.
    low   = index * self.batch_size
    high  = min(low + self.batch_size, len(self.x))
    idx   = self.indices[low:high]
    #high = min(low+self.batch_size,len(self.x))
    batch_x_path = np.array([self.x[i] for i in idx])
    batch_y_path = np.array([self.y[i] for i in idx])

    batch_x = np.array([self.__getimage(file_name) for file_name in batch_x_path])
    batch_y = np.array([self.__getmask(file_name) for file_name in batch_y_path])
    batch_x,batch_y = self.__augment(batch_x,batch_y)
    #print("shape batch: ",batch_x.shape," dtype: ",batch_x.dtype)
    #print("shape batch: ",batch_y.shape," dtype: ",batch_y.dtype)

    return batch_x, keras.utils.to_categorical(batch_y,num_classes=8,dtype="float32")

  def on_epoch_end(self): # metodo chiamato alla fine di ogni epoca
    if self.shuffle:
      np.random.shuffle(self.indices)
      # cambiare l'ordine di esplorazione del dataset permette di ottenere una maggiore robustezza

