def outsegcolor(label_map):
    # Assegno colori RGB alle 7+1 classi(livelli di grigio) della mappa di segmentazione
    colors = np.array([
        [18, 64, 128],      # Drivable # marrone
        [232, 35, 244],     # Non Drivable #rosa
        [60, 20, 220],      # Living Things #rosso
        [230, 0, 0],        # Vehicles #blu
        [40, 190, 220],     # Road Side Objects #giallo
        [70, 70, 70],       # Far Objects #grigio
        [180, 130, 70],     # Sky #azzurro
        [0, 0, 0]           # Misc #nero
    ], dtype=int)

    color_image = np.zeros(
        (label_map.shape[0], label_map.shape[1], 3), dtype=int)
    for i in range(7):
        color_image[label_map == i] = colors[i]

    color_image[label_map == 7] = colors[7]
    return color_image

